USE RAD_SCHEME_PARAMETERS, ONLY: RRAE, RCARDI, RCH4, RN2O, RNO2, RO3, &
    RCFC11, RCFC12, RCFC22, RCCL4, REPCLC, REPH2O, RSUNDUR, &
    RCCO2, RCCH4, RCN2O, RCNO2, RCCFC11, RCCFC12, RCCFC22, RCCCL4, &
    LAQUA

IMPLICIT NONE

REAL :: ZAIRMWG, ZC11MWG, ZC12MWG, ZCH4MWG, ZCO2MWG,&
 & ZN2OMWG, ZNO2MWG, ZO3MWG, ZC22MWG, ZCL4MWG

!      ----------------------------------------------------------------

!*       1.    SET DEFAULT VALUES.
!              -------------------

RRAE = 0.1277E-02

!* Threshold for computing sunshine duration (W/m2)
RSUNDUR=120.

!*  For sea ice, monthly values are based on Ebert and Curry, 1993, Table 2.
!   We take dry snow albedo as the representative value for non-summer
!   months, and bare sea-ice as the representative value for summer
!   months. The values for Antarctic are shifted six-months.
! All computations brought back to *SUSWN*

!*  Concentration of the various trace gases (IPCC/SACC values for 1990)
!        CO2         CH4        N2O        CFC11       CFC12
!      353ppmv     1.72ppmv   310ppbv     280pptv     484pptv

ZAIRMWG = 28.970
ZCO2MWG = 44.011
ZCH4MWG = 16.043
ZN2OMWG = 44.013
ZNO2MWG = 46.006
ZO3MWG  = 47.9982
ZC11MWG = 137.3686
ZC12MWG = 120.9140
ZC22MWG =  86.4690
ZCL4MWG = 153.8230

!RCARDI  = 353.E-06*ZCO2MWG/ZAIRMWG
!RCH4    = 1.72E-06*ZCH4MWG/ZAIRMWG
!RN2O    = 310.E-09*ZN2OMWG/ZAIRMWG
!RNO2    = 500.E-13*ZNO2MWG/ZAIRMWG
!RO3     =   1.E-06*ZO3MWG /ZAIRMWG
!RCFC11  = 280.E-12*ZC11MWG/ZAIRMWG
!RCFC12  = 484.E-12*ZC12MWG/ZAIRMWG
!RCFC22  =   1.E-12*ZC22MWG/ZAIRMWG
!RCCL4   =   1.E-12*ZCL4MWG/ZAIRMWG

IF( LAQUA ) THEN
  RCARDI  = 348.E-06*ZCO2MWG/ZAIRMWG
  RCH4    = 1.65E-06*ZCH4MWG/ZAIRMWG
  RN2O    = 306.E-09*ZN2OMWG/ZAIRMWG
ELSE
  RCARDI  = RCCO2   * ZCO2MWG/ZAIRMWG
  RCH4    = RCCH4   * ZCH4MWG/ZAIRMWG
  RN2O    = RCN2O   * ZN2OMWG/ZAIRMWG
ENDIF

RNO2    = RCNO2   * ZNO2MWG/ZAIRMWG 
RO3     = 1.E-06*ZO3MWG /ZAIRMWG
RCFC11  = RCCFC11 * ZC11MWG/ZAIRMWG
RCFC12  = RCCFC12 * ZC12MWG/ZAIRMWG
RCFC22  = RCCFC22 * ZC22MWG/ZAIRMWG
RCCL4   = RCCCL4  * ZCL4MWG/ZAIRMWG

REPCLC=1.E-12
REPH2O=1.E-12

!     -----------------------------------------------------------------

END SUBROUTINE SURDI
