ENDIF
!     ------------------------------------------------------------------

!*         1.     TIME INDEX WITHIN OZONE CLIMATOLOGY
!                 -----------------------------------

IDY=MOD(KINDAT,100)
IMN=MOD((KINDAT-IDY)/100,100)
IDY=IDY-1
IF (IMN == 1) THEN
  ZXTIME=REAL(IDY,KIND(ZXTIME))*1440. + KMINUT
ELSEIF (IMN == 2) THEN
  IF(IDY == 28) IDY=IDY-1
! A DAY IN FEB. IS 28.25*24*60/28=1452.8571min LONG.
  ZXTIME=44640.+REAL(IDY,KIND(ZXTIME))*1452.8571+KMINUT
ELSE
  ZXTIME=(ZMDAY(IMN-1)+REAL(IDY,KIND(ZXTIME)))*1440.+KMINUT
ENDIF
! 525960=MINUTES IN A SIDERAL YEAR (365.25d)
ZXTIME=MOD(ZXTIME,525960.)

IM1=0
IM2=0
IF (ZXTIME <= ZYTIME(1)) THEN
  IM1=12
  IM2=1
  ZTIMI=(ZYTIME(1)-ZXTIME)/44640.
ELSEIF(ZXTIME > ZYTIME(12)) THEN
  IM1=12
  IM2=1
  ZTIMI=(548280.-ZXTIME)/44640.
! 548280.=(365.25d + 15.5d)*24*60
ELSE
  DO IM=1,11
    IF (ZXTIME > ZYTIME(IM) .AND. ZXTIME <= ZYTIME(IM+1)) THEN
      IM1=IM
      IM2=IM+1
      ZTIMI=(ZXTIME-ZYTIME(IM2))/(ZYTIME(IM1)-ZYTIME(IM2))
    ENDIF
  ENDDO
  IF (IM1 == 0.OR. IM2 == 0 ) THEN
!    CALL ABOR1('Problem with time interpolation in suecozc!')
    STOP 'Problem with time interpolation in suecozc!'
  ENDIF
ENDIF

!*         2.0    TIME INTERPOLATED FIELD
!                 -----------------------

!*( Field is also transformed in kg/kg! )

DO JK=1,34
  DO JL=1,19
    ROZT(JL,JK)=RO3 * (ZOZCL(JL,JK,IM2)&
     & +ZTIMI*(ZOZCL(JL,JK,IM1)-ZOZCL(JL,JK,IM2)))  
  ENDDO
ENDDO
DO JL=1,19
  ROZT(JL, 0)=0.0
  ROZT(JL,35)=ROZT(JL,34)
ENDDO
ZINCROZ=RPERTOZ
IF (RPERTOZ /= 0.0) THEN
  DO JL=6,14
    ZINCL=SIN( FLOAT(JL-6)/4.*RPI/2. )
!-- perturbation of Ozone climatology above tropopause (10-100 hPa)
    IF (NPERTOZ == 0) THEN
      DO JK=23,29
        ZINCH=SIN( FLOAT(JK-23)/3.0*RPI/2.0 )
        ROZT(JL,JK)=ROZT(JL,JK) * (1.0 + ZINCROZ*ZINCL*ZINCH)
      ENDDO
!-- perturbation of Ozone climatology below tropopause (50-500 hPa)
    ELSEIF (NPERTOZ == 1) THEN
      DO JK=27,33
        ZINCH=SIN( FLOAT(JK-27)/3.0*RPI/2.0 )
        ROZT(JL,JK)=ROZT(JL,JK) * (1.0 + ZINCROZ*ZINCL*ZINCH)
      ENDDO
    ENDIF
  ENDDO
ENDIF


!     VECTOR OF LATITUDES FOR OZONE CLIMATOLOGY:

DO JL=1,19
  RSINC(JL)=SIN((-90.+(JL-1)*10.)*RPI/180.)
ENDDO

LLFIRSTCALL = .FALSE.


!-----------------------------------------------------------------------------

CONTAINS


