!     PURPOSE.
!     --------

!          THIS ROUTINE COMPUTES INSTANTANEOUS VALUES OF A T5 SPETRAL
!     DISTRIBUTION FOR TWO OZONE PARAMETERS (TOTAL QUANTITY AND PRESSURE
!     AT THE MAXIMUM OF CONCENTRATION,BOTH IN *PASCAL) FROM THE TIME
