 & +.8953E+00/)  

INTEGER :: JMN

REAL :: ZC1YT, ZC2YT, ZS1YT, ZS2YT, ZYTIME

!     ------------------------------------------------------------------

!*         1.     PRELIMINARY SETTING.
!                 ----------- --------

ZYTIME=PYTIME

!     ------------------------------------------------------------------

!*         2.     COMPUTATIONS.
!                 -------------

ZC1YT=COS(ZYTIME)
ZS1YT=SIN(ZYTIME)
ZC2YT=ZC1YT**2-ZS1YT**2
ZS2YT=2.0*ZS1YT*ZC1YT
DO JMN=1,21
  COZQC(JMN)=ZOZQC0(JMN)+2.0*(ZOZQC1(JMN)*ZC1YT+ZOZQC2(JMN)*ZS1YT &
   & +ZOZQC3(JMN)*ZC2YT+ZOZQC4(JMN)*ZS2YT)  
  COZHC(JMN)=ZOZHC0(JMN)+2.0*(ZOZHC1(JMN)*ZC1YT+ZOZHC2(JMN)*ZS1YT &
   & +ZOZHC3(JMN)*ZC2YT+ZOZHC4(JMN)*ZS2YT)  
ENDDO
DO JMN=1,15
  COZQS(JMN)=ZOZQS0(JMN)+2.0*(ZOZQS1(JMN)*ZC1YT+ZOZQS2(JMN)*ZS1YT &
   & +ZOZQS3(JMN)*ZC2YT+ZOZQS4(JMN)*ZS2YT)  
  COZHS(JMN)=ZOZHS0(JMN)+2.0*(ZOZHS1(JMN)*ZC1YT+ZOZHS2(JMN)*ZS1YT &
   & +ZOZHS3(JMN)*ZC2YT+ZOZHS4(JMN)*ZS2YT)  
ENDDO
