!     AEROSOL TOTAL OPTICAL THICKNESS (0.55 MICRON)

!-- TEGEN ET AL. MONTHLY CLIMATOLOGY OF TROPOSPHERIC AEROSOLS

! RTAEBC : BLACK CARBON AEROSOL
! RTAEOR : ORGANIC AEROSOL
! RTAESD : SAND DUST AEROSOL
! RTAESS : SEA SALT AEROSOL
! RTAESU : SULFATE AEROSOL

!-- GISS HISTORY OF STRATOSPHERIC VOLCANIC AEROSOLS

! RTAEVO : VOLCANIC AEROSOL

!        IMPLICIT ARGUMENTS :   NONE
!        --------------------

!     METHOD.
!     -------

!     EXTERNALS.
!     ----------

!          NONE

!     REFERENCE.
!     ----------

!        SEE RADIATION'S PART OF THE MODEL'S DOCUMENTATION AND
!        ECMWF RESEARCH DEPARTMENT DOCUMENTATION OF THE "I.F.S"

!     AUTHOR.
!     -------
!     J.-J. MORCRETTE  E.C.M.W.F.    98/12/21

!     MODIFICATIONS.
!     --------------
!     990115: JJMorcrette, Volcanic aerosols
!     990525: JJMorcrette, Monthly Climatology of Tropospheric Aerosols
!        M.Hamrud      01-Oct-2003 CY28 Cleaning
!     R. Elkhatib 12-10-2005 Split for faster and more robust compilation.
!     JJ.Morcrette 20080206 revision handling GISS volcanic aerosols
!     H.Hersbach  08-11-2010 Option for reading GISS volcanic aerosols from file
!-----------------------------------------------------------------------

USE RAD_SCHEME_PARAMETERS, ONLY : RAERBC, RAEROR, RAERSD, RAERSS, RAERSU, &
 REPAER, RTAEBC, RTAEOR, RTAESD, RTAESS, RTAESU, RTAEVO

IMPLICIT NONE

INTEGER,INTENT(IN)    :: KINDAT
INTEGER,INTENT(IN)    :: KMINUT
!     -----------------------------------------------------------------

!*       0.1   ARGUMENTS.
!              ----------

!*       0.2   LOCAL ARRAYS.
!              -------------

INTEGER,PARAMETER    :: ISHIST=1850, IEHIST=2100, INLAT=24
REAL,SAVE :: ZLATV(INLAT) , ZAERV(INLAT,ISHIST:IEHIST,12)
REAL,SAVE :: ZYTIME(12), ZMDAY(12)

INTEGER :: IDY, IM, IM1, IM2, IMN, IYR, IYR1, IYR2, JI, JL
INTEGER :: IDYADD, IDAYMIN, IT1, IT2, INYR, INMN, INDY, IMV1, IMV2
INTEGER :: ILMO(12)

INTEGER :: IU,INLEV,IYEAR,ILAT,IDUM
REAL    :: Z_GRID, ZINT, ZLAT, ZRES, ZRESM, ZRESP, ZTIMI, ZXTIME
REAL    :: ZHOOK_HANDLE, ZW1, ZW2, ZAERVY(12)
CHARACTER(LEN=1000):: CLINE

INTEGER,SAVE :: ISYEAR=IEHIST, IEYEAR=ISHIST
LOGICAL           ,SAVE :: LLFIRSTCALL = .TRUE.

!     ------------------------------------------------------------------

! - Time functions
!   the descriptions are in the annex 1 of the documentation

! TIME

! NDD   : extraxt dd from ccaammdd
! NMM   : extract mm from ccaammdd
! NAA   : extract aa from ccaammdd
! NCCAA : extract ccaa from ccaammdd
! NAMD  : extract aammdd from ccaammdd
! NCENT : return centuary of ccaammdd
! NYEARC: returns year of the centuary from ccaammdd
! NCONSTRUCT_DATE : returns ccaammdd given centuary,year,month and day
! NCTH  : turn seconds into hours
! RTIME : returns the time of the model (in seconds of course!)
! RINCDAY : length of a day (in seconds)

INTEGER :: NDD,NMM,NCCAA,NAA,NAMD,NCTH,NZZAA,NZZMM,NCENT,NYEARC,&
&NCONSTRUCT_DATE
REAL :: RJUDAT,RTIME,RINCDAY
INTEGER :: KGRDAT,KSEC,KAAAA,KMM,KDD,KSS
INTEGER :: KCENT,KYEARC,KMONTH,KDAY

NDD(KGRDAT)  =MOD(KGRDAT,100)
NMM(KGRDAT)  =MOD((KGRDAT-NDD(KGRDAT))/100,100)
NCCAA(KGRDAT)=KGRDAT/10000
NAA(KGRDAT)=MOD(NCCAA(KGRDAT),100)
NAMD(KGRDAT)=MOD(KGRDAT,1000000)
NCTH(KSEC)=KSEC/3600
NCENT(KGRDAT)=NCCAA(KGRDAT)/100+MIN(NAA(KGRDAT),1)
NYEARC(KGRDAT)=NAA(KGRDAT)+100*(1-MIN(NAA(KGRDAT),1))
NCONSTRUCT_DATE(KCENT,KYEARC,KMONTH,KDAY)=&
&(KCENT-1)*10**6+KYEARC*10**4+KMONTH*10**2+KDAY

NZZAA(KAAAA,KMM)=KAAAA-( (1-SIGN(1,KMM-3))/2 )
NZZMM(KMM)=KMM+6*(1-SIGN(1,KMM-3))
RJUDAT(KAAAA,KMM,KDD)=1720994.5 + REAL(&
  &2-NZZAA(KAAAA,KMM)/100 + (NZZAA(KAAAA,KMM)/100)/4 &
&+ INT(365.25*REAL(NZZAA(KAAAA,KMM)))&
&+ INT(30.601*REAL(NZZMM(KMM)+1))&
&+ KDD)
RTIME(KAAAA,KMM,KDD,KSS,RINCDAY)=(RJUDAT(KAAAA,KMM,KDD)-2451545.)&
    &*RINCDAY+REAL(KSS)


!     ------------------------------------------------------------------

!IF (LHOOK) CALL DR_HOOK('SUECAEC',0,ZHOOK_HANDLE)

IF(LLFIRSTCALL) THEN

  ZMDAY = (/&
   & 31. ,    59.25 ,  90.25 , 120.25 , 151.25 , 181.25  &
   & ,  212.25 , 243.25 , 273.25 , 304.25 , 334.25 , 365.25  &
   & /)
  ZYTIME= (/&
   & 22320. ,  64980. , 107640. , 151560. , 195480. , 239400.  &
   & , 283320. , 327960. , 371880. , 415800. , 459720. , 503640.  &
   & /)

  INLEV=0
  ZAERV(:,:,:)=0.0

!- Use hard-coded Volcanic GISS data; runs from 1957 only; not latest available set
  ISYEAR=1957
!  IEYEAR =2010
  IEYEAR =2017 ! Andrea
  CALL PART1
  CALL PART2
  CALL PART3
  CALL PART4
  CALL PART5
  CALL PART6
  CALL PART7
  CALL PART8

!   - Rescale to optical depth
  ZAERV(:,:,:)=1.E-04 *ZAERV(:,:,:)

!  WRITE(NULOUT,'(A,I3,2I6)')"SUECAEC: INLEV,ISYEAR,IEYEAR=",INLEV,ISYEAR,IEYEAR

ENDIF
!     ------------------------------------------------------------------

!*         1.     TIME INDEX WITHIN AEROSOL CLIMATOLOGY
!                 -------------------------------------

!*         1.1    SEASONAL TIME INDEX WITHIN TEGEN'S AEROSOL CLIMATOLOGY
!                 ------------------------------------------------------

IDY=MOD(KINDAT,100)
IMN=MOD((KINDAT-IDY)/100,100)
IDY=IDY-1
IF (IMN == 1) THEN
  ZXTIME=REAL(IDY)*1440.  + KMINUT
ELSEIF (IMN == 2) THEN
  IF(IDY == 28) IDY=IDY-1
! A DAY IN FEB. IS 28.25*24*60/28=1452.8571min LONG.
  ZXTIME=44640. +REAL(IDY)*1452.8571 +KMINUT
ELSE
  ZXTIME=(ZMDAY(IMN-1)+REAL(IDY))*1440. +KMINUT
ENDIF
! 525960=MINUTES IN A SIDERAL YEAR (365.25d)
ZXTIME=MOD(ZXTIME,525960. )

IM1=0
IM2=0
IF (ZXTIME <= ZYTIME(1)) THEN
  IM1=12
  IM2=1
  ZTIMI=(ZYTIME(1)-ZXTIME)/44640.
ELSEIF(ZXTIME > ZYTIME(12)) THEN
  IM1=12
  IM2=1
  ZTIMI=(548280. -ZXTIME)/44640.
! 548280.=(365.25d + 15.5d)*24*60
ELSE
  DO IM=1,11
    IF (ZXTIME > ZYTIME(IM) .AND. ZXTIME <= ZYTIME(IM+1)) THEN
      IM1=IM
      IM2=IM+1
      ZTIMI=(ZXTIME-ZYTIME(IM2))/(ZYTIME(IM1)-ZYTIME(IM2))
    ENDIF
  ENDDO
  IF (IM1 == 0.OR. IM2 == 0 ) THEN
!    CALL ABOR1('Problem with time interpolation in suecaec!')
    STOP 'Problem with time interpolation in suecaec!'
  ENDIF
ENDIF

!*         1.2    TIME INDEX WITHIN GISS VOLCANIC AEROSOL CLIMATOLOGY
!                 ---------------------------------------------------

IYR=KINDAT/10000
IDY=MOD(KINDAT,100)
IMN=MOD((KINDAT-IDY)/100,100)

IDYADD=KMINUT/1440
IDAYMIN=KMINUT-1440*IDYADD

CALL UPDCAL(IDY,IMN,IYR,IDYADD,INDY,INMN,INYR,ILMO,-1)

! Assume monthly means valid at 0Z on the 16th of each month and interpolate linearly

IF(INDY >= 16) THEN
  IMV1=INMN
  IMV2=1+MOD(INMN,12)
  IYR1=INYR
  IF(IMV1 /= 12) THEN
    IYR2=INYR
  ELSE
    IYR2=INYR+1
  ENDIF
  IT1=16
  IT2=16+ILMO(IMV1)
ELSE
  IMV1=1+MOD(INMN+10,12)
  IMV2=INMN
  IF(IMV1 /= 12) THEN
    IYR1=INYR
  ELSE
    IYR1=INYR-1
  ENDIF
  IYR2=INYR
  IT1=16-ILMO(IMV1)
  IT2=16
ENDIF
! Ensure date within range as provided in data set
IYR1=MAX(IYR1,ISYEAR)
IYR2=MAX(IYR2,ISYEAR)
IYR1=MIN(IYR1,IEYEAR)
IYR2=MIN(IYR2,IEYEAR)

ZW1=REAL(IT2*1440-(INDY*1440+IDAYMIN))/REAL((IT2-IT1)*1440)
ZW2=1.0 -ZW1


!*         2.0    TOTAL OPTICAL THICKNESS
!                 -----------------------

!*         2.1    TROPOSPHERIC AEROSOL MONTHLY CLIMATOLOGY
!                 ----------------------------------------

!-- VECTOR OF LATITUDES FOR TEGEN ET AL. AEROSOL CLIMATOLOGY:

DO JI=1,46
  DO JL=1,72
    RTAEBC(JL,JI)=RAERBC(JL,JI,IM2)&
     & +ZTIMI*(RAERBC(JL,JI,IM1)-RAERBC(JL,JI,IM2))
    RTAEOR(JL,JI)=RAEROR(JL,JI,IM2)&
     & +ZTIMI*(RAEROR(JL,JI,IM1)-RAEROR(JL,JI,IM2))
    RTAESD(JL,JI)=RAERSD(JL,JI,IM2)&
     & +ZTIMI*(RAERSD(JL,JI,IM1)-RAERSD(JL,JI,IM2))
    RTAESS(JL,JI)=RAERSS(JL,JI,IM2)&
     & +ZTIMI*(RAERSS(JL,JI,IM1)-RAERSS(JL,JI,IM2))
    RTAESU(JL,JI)=RAERSU(JL,JI,IM2)&
     & +ZTIMI*(RAERSU(JL,JI,IM1)-RAERSU(JL,JI,IM2))
  ENDDO
ENDDO

!*         2.2    VOLCANIC AEROSOL CLIMATOLOGY
!                 ----------------------------

! print *, 'suecaec: iyr1,imv1,zw1,iyr2,imv2,zw2',iyr1,imv1,zw1,iyr2,imv2,zw2

Z_GRID=4.
DO JI=1,46
  ZLAT=90. -(JI-1)*Z_GRID
  DO JL=1,23
    IF (ZLAT == ZLATV(JL)) THEN
      ZRES=ZW1*ZAERV(JL,IYR1,IMV1)+ZW2*ZAERV(JL,IYR2,IMV2)
    ELSEIF (ZLAT < ZLATV(JL).AND.ZLAT >= ZLATV(JL+1))THEN
      ZINT=(ZLAT-ZLATV(JL+1))/(ZLATV(JL)-ZLATV(JL+1))
      ZRESM=ZW1*ZAERV(JL  ,IYR1,IMV1)+ZW2*ZAERV(JL  ,IYR2,IMV2)
      ZRESP=ZW1*ZAERV(JL+1,IYR1,IMV1)+ZW2*ZAERV(JL+1,IYR2,IMV2)
      ZRES=ZRESP-ZINT*(ZRESP-ZRESM)
    ENDIF
  ENDDO
  RTAEVO(JI)=ZRES
ENDDO

! WRITE(NULOUT,*)"SUECAEC: GLOBAL AVERAGE VOLCANIC SULPHATE FOR (KINDAT,KMINUT) ", &
!    & KINDAT, KMINUT, SUM(RTAEVO)/46.

!-- security for aerosol optical thickness
REPAER=1.E-12

!     ------------------------------------------------------------------

LLFIRSTCALL = .FALSE.

!IF (LHOOK) CALL DR_HOOK('SUECAEC',1,ZHOOK_HANDLE)

!-----------------------------------------------------------------------------

CONTAINS


