SUBROUTINE SUAERV &
 & (  KLEV  , PETAH,&
 & PVDAES, PVDAEL, PVDAEU, PVDAED,&
 & PTRBGA, PVOBGA, PSTBGA, PAEOPS, PAEOPL, PAEOPU,&
 & PAEOPD, PTRPT , PAEADK, PAEADM, PAEROS &
 & )

!**** *SUAERV* - PARAMETERS FOR THE VERTICAL DISTRIBUTIONS OF AEROSOLS.

!     PURPOSE.
!     --------

!          THIS ROUTINE COMPUTES THE VALUES *PVDAEN* (*N=*S,*L,*U OR *D
!     FOR SEA,LAND,URBAN OR DESERT) OF A SURFACE-NORMALISED VERTICAL
!     DISTRIBUTION OF AEROSOLS' OPTICAL DEPHTS FROM THE ARGUMENT *PETAH*
!     (VERTICAL COORDINATE) AT *KLEVP1* LEVELS. IT ALSO SETS VALUES FOR
!     NON-GEOGRAPHICALLY WEIGHTED TOTAL OPTICAL DEPTHS (AT 0.55 E-06
!     WAVE-LENGTH) *PAEOPN* FOR THE SAME FOUR TYPES AND SIMILAR OPTICAL
!     DEPHTS DIVIDED BY PRESSURE FOR BACKGROUND WELL-MIXED AEROSOLS
!     OF THREE TYPES *PMNBGA* (*MN*=*TR*,*VO* OR *ST* FOR TROPOSPHERIC,
!     VOLCANIC (STRATOSPHERIC ASHES) OR STRATOSPHERIC (SULFURIC TYPE)).
!     IT FINALLY SET VALUES FOR THE POWER TO BE APPLIED TO A TEMPERATURE
!     RATIO SMALLER THAN ONE IN ORDER TO OBTAIN AN INDEX ONE IN THE
!     STRATOSPHERE AND ZERO IN THE TROPOSPHERE WITH A RELATIVELY SMOOTH
!     TRANSITION (*PTRPT*), AS WELL AS FOR ADSORPTION COEFFICIENTS FOR
!     WATER TO THE THREE TYPE OF TROPOSPHERIC AEROSOLS (*PAEADK*) WITH
!     A MINIMUM VALUE (IN THE WHOLE ATMOSPHERE) FOR THE SUM OF THE
!     PRODUCTS OF *PAEADK* BY THE OPTICAL DEPTHS DIVIDED BY PRESURE
!     THICKNESS: *PAEADM*.

!**   INTERFACE.
!     ----------

!          *SUAERV* IS CALLED FROM *SUECRAD*.
!          THERE ARE SIXTEEN DUMMY ARGUMENTS: *PETAH* IS THE VERTICAL
!     COORDINATE.
!                                             *PVDAEN* (*N=*S,*L,*U OR
!     *D) ARE THE NORMALISED VERTICAL DISTRIBUTIONS.
!                                             *KLEVP1* IS THE NUMBER OF
!     LEVELS.
!                                             *PMNBGA* (*MN*=*TR*,*VO*
!     OR *ST*) ARE THE BACKGROUND OPTICAL DEPTHS DIVIDED BY PRESSURE.
!                                             *PAEOPN* (*N=*S,*L,*U OR
!     *D) ARE THE TOTAL OPTICAL DEPHTS FOR THE VERTICALLY VARYING
!     AEROSOLS.
!                                             *PTRPT* IS THE TEMPERATURE
!     EXPONENT FOR THE STRATOSPHERIC DEFINITION.
!                                             *PAEADK* (1,2,3) AND
!     AND *PAEADM* ARE THE CONSTANTS FOR THE DEFINITION OF THE QUANTITY
!     OF WATER VAPOUR THAT WILL BE ADSORBED TO THE DRY AEROSOLS TO FORM
!     MOIST AEROSOLS.

!     METHOD.
!     -------

!          STRAIGHTFORWARD, EQUIVALENT HEIGTHS ARE GIVEN IN METERS (8434
!     FOR THE ATMOSPHERE) AND TROPOSPHERIC AND STRATOSPHERIC PRESSURE
!     BOUNDARY VALUES ARE SET AT 101325 AND 19330 *PASCAL.

!     EXTERNALS.
!     ----------

!          NONE.

!     REFERENCE.
!     ----------

!          NONE.

!     AUTHOR
!     ------
!     J.-F. GELEYN     E.C.M.W.F.     04/11/82.

!     MODIFICATIONS
!     -------------
!     J.-J. MORCRETTE  E.C.M.W.F.     91/07/14   ADAPTATION TO I.F.S.
!     JJ Morcrette 960903  block data SUAERH moved after end of SUAERV
!        M.Hamrud      01-Oct-2003 CY28 Cleaning

!     ------------------------------------------------------------------

IMPLICIT NONE

INTEGER,INTENT(IN)    :: KLEV
REAL   ,INTENT(IN)    :: PETAH(KLEV+1)
REAL   ,INTENT(OUT)   :: PVDAES(KLEV+1)
REAL   ,INTENT(OUT)   :: PVDAEL(KLEV+1)
REAL   ,INTENT(OUT)   :: PVDAEU(KLEV+1)
REAL   ,INTENT(OUT)   :: PVDAED(KLEV+1)
REAL   ,INTENT(OUT)   :: PTRBGA
REAL   ,INTENT(OUT)   :: PVOBGA
REAL   ,INTENT(OUT)   :: PSTBGA
REAL   ,INTENT(OUT)   :: PAEOPS
REAL   ,INTENT(OUT)   :: PAEOPL
REAL   ,INTENT(OUT)   :: PAEOPU
REAL   ,INTENT(OUT)   :: PAEOPD
REAL   ,INTENT(OUT)   :: PTRPT
REAL   ,INTENT(OUT)   :: PAEADK(3)
REAL   ,INTENT(OUT)   :: PAEADM
REAL   ,INTENT(OUT)   :: PAEROS
!     ------------------------------------------------------------------
INTEGER :: JK

REAL :: ZHSD, ZHSL, ZHSS, ZHSU

!     ------------------------------------------------------------------

!*         1.     COMPUTATIONS.
!                 -------------

ZHSS=MAX(1.0,8434./1000.)
ZHSL=MAX(1.0,8434./1000.)
ZHSU=MAX(1.0,8434./1000.)
ZHSD=MAX(1.0,8434./3000.)
PVDAES(1)=0.
PVDAEL(1)=0.
PVDAEU(1)=0.
PVDAED(1)=0.
IF(PETAH(1) /= 0.0) THEN
  PVDAES(1)=PETAH(1)**ZHSS
  PVDAEL(1)=PETAH(1)**ZHSL
  PVDAEU(1)=PETAH(1)**ZHSU
  PVDAED(1)=PETAH(1)**ZHSD
ENDIF
DO JK=2,KLEV+1
  PVDAES(JK)=PETAH(JK)**ZHSS
  PVDAEL(JK)=PETAH(JK)**ZHSL
  PVDAEU(JK)=PETAH(JK)**ZHSU
  PVDAED(JK)=PETAH(JK)**ZHSD
ENDDO
PTRBGA= 0.03/(101325.-19330.)
PVOBGA= 0.007/19330.
PSTBGA= 0.045/19330.
PAEOPS= 0.05
PAEOPL= 0.2
PAEOPU= 0.1
PAEOPD= 1.9
PTRPT = 30.
PAEADK(1)=+.3876E-03
PAEADK(2)=+.6693E-02
PAEADK(3)=+.8563E-03
PAEADM   = 2.6E-10

PAEROS   = 0.1462E-16

!     ------------------------------------------------------------------

END SUBROUTINE SUAERV
SUBROUTINE RADACA ( KIDIA , KFDIA , KLON , KTDIA , KLEV,&
 & PAPRS , PGELAM, PSIN  , PCLON, PSLON , PTH,&
 & PAER  , POZON                         )  

! Subroutine of ECWWF radiation scheme (1997)

!***********************************************************************
! CAUTION: THIS ROUTINE WORKS ONLY ON A NON-ROTATED, UNSTRETCHED GRID
!***********************************************************************

!**** *RADACA  - COMPUTES DISTRIBUTION OF AEROSOLS AND OZONE
!                >>> FOR ASSIMILATION AND UV-DIAGNOSTIC PURPOSES <<

!     PURPOSE.
!     --------

!**   INTERFACE.
!     ----------
!        CALL *RADACA* FROM *RADINA*
!                      FROM *CALLPAR* for UV diagnostics 

!        EXPLICIT ARGUMENTS :
!        --------------------
!     ==== INPUTS ===
!     ==== OUTPUTS ===

!        IMPLICIT ARGUMENTS :   NONE
!        --------------------

!     METHOD.
!     -------

!     EXTERNALS.
!     ----------

!          NONE

!     REFERENCE.
!     ----------

!        SEE RADIATION'S PART OF THE MODEL'S DOCUMENTATION AND
!        ECMWF RESEARCH DEPARTMENT DOCUMENTATION OF THE "I.F.S"

!     AUTHOR.
!     -------

!     J.-F. MAHFOUF    E.C.M.W.F.    97/07/04

!     Aadapted from

!     J.-J. MORCRETTE  E.C.M.W.F.    91/03/15

!     MODIFICATIONS.
!     --------------
!     J.-J. MORCRETTE  E.C.M.W.F.    93/03/15   OPERATIONAL CLIMATOLOGY
!     JJMorcrette  99-05-25     Revised aerosols (over 6 types)
!     JJMorcrette  03-05-01     Tegen et al's aerosols
!     J.HAGUE      01/07/03     Modified for bit reproducibility
!        M.Hamrud      01-Oct-2003 CY28 Cleaning
!-----------------------------------------------------------------------

USE RAD_SCHEME_PARAMETERS, ONLY : &
 CVDAES,   CVDAEL,   CVDAEU,   CVDAED, &
 RCAEOPS,  RCAEOPL,  RCAEOPU,  RCAEOPD,  RCTRBGA, &
 RCVOBGA  ,RCSTBGA  ,RCTRPT   ,RAESC    ,RAESS    ,&
 RAELC    ,RAELS    ,RAEUC    ,RAEUS    ,RAEDC    ,&
 RAEDS, & 
 COZQC    ,COZQS    ,COZHC    ,COZHS, &
 LHVOLCA  ,LNEWAER, &
 REPAER   ,&
 RTAEBC  ,RTAEOR   ,RTAESD   ,RTAESS   ,RTAESU   , &
 RTAEVO, RPI  

IMPLICIT NONE

INTEGER,INTENT(IN)    :: KLON 
INTEGER,INTENT(IN)    :: KLEV 
INTEGER,INTENT(IN)    :: KIDIA 
INTEGER,INTENT(IN)    :: KFDIA 
INTEGER               :: KTDIA ! Argument NOT used
REAL   ,INTENT(IN)    :: PAPRS(KLON,0:KLEV) 
REAL   ,INTENT(IN)    :: PGELAM(KLON) 
REAL   ,INTENT(IN)    :: PSIN(KLON) 
REAL   ,INTENT(IN)    :: PCLON(KLON) 
REAL   ,INTENT(IN)    :: PSLON(KLON) 
REAL   ,INTENT(IN)    :: PTH(KLON,KLEV+1) 
REAL   ,INTENT(OUT)   :: PAER(KLON,6,KLEV) 
REAL   ,INTENT(OUT)   :: POZON(KLON,KLEV) 
!     -----------------------------------------------------------------

!*       0.1   ARGUMENTS.
!              ----------

!     -----------------------------------------------------------------

!*       0.2   LOCAL ARRAYS.
!              -------------

!--
INTEGER :: IINLA1(KLON), IINLA2(KLON)
INTEGER :: IINLO1(KLON), IINLO2(KLON)

REAL :: ZAERBC(KLON), ZAEROR(KLON), ZAERSD(KLON)
REAL :: ZAERSS(KLON), ZAERSU(KLON), ZAERVO(KLON)
REAL :: ZSILAT(KLON), ZSINR(46), ZLONR(72), ZLON(KLON), ZNLO1(KLON), ZNLO2(KLON)

INTEGER :: INLA, INLA1, INLA2, INLO1, INLO2, &
 & JLR, ITLATR, ITLONR, JAER  

REAL :: ZAERBC1, ZAERBC2, ZAEROR1, ZAEROR2, ZAERSD1, ZAERSD2, &
 & ZAERSS1, ZAERSS2, ZAERSU1, ZAERSU2  
REAL :: ZDLONR, ZGRIDR, ZLATR
!--

REAL :: ZALP(66,KLON)
REAL :: ZFOZQ(11,KLON),ZFOZH(11,KLON)
REAL :: ZFAES(21,KLON),ZFAEL(21,KLON),ZFAEU(21,KLON),ZFAED(21,KLON)

REAL :: ZDPN (KLON) ,ZDPO (KLON) ,ZQOFN(KLON) ,ZQOFO(KLON)
REAL :: ZOZH (KLON) ,ZOZQ (KLON)
REAL :: ZAEQSN(KLON),ZAEQSO(KLON),ZAEQLN(KLON),ZAEQLO(KLON)
REAL :: ZAEQUN(KLON),ZAEQUO(KLON),ZAEQDN(KLON),ZAEQDO(KLON)
REAL :: ZAETRN(KLON),ZAETRO(KLON)
REAL :: ZAES  (KLON),ZAEL  (KLON),ZAEU  (KLON),ZAED  (KLON)
REAL :: ZSIN(KLON)


INTEGER :: IMM, IMNC, IMNS, JK, JL, JMM, JNN

REAL :: ZAETR, ZCOS1, ZCOS10, ZCOS2, ZCOS3, ZCOS4,&
 & ZCOS5, ZCOS6, ZCOS7, ZCOS8, ZCOS9, ZCPHN3, &
 & ZCPHO3, ZDPNMO, ZSDPN3, ZSDPO3, ZSIN1, &
 & ZSIN10, ZSIN2, ZSIN3, ZSIN4, ZSIN5, ZSIN6, &
 & ZSIN7, ZSIN8, ZSIN9  

!     ------------------------------------------------------------------

!*         1.     "NEW AEROSOL DISTRIBUTION" PARAMETERS COMPUTATIONS
!                 --------------------------------------------------


!*         1.1    VOLCANIC AEROSOL DISTRIBUTION PARAMETERS
!                 ----------------------------------------

!                 GISS CLIMATOLOGY 
!                 ----------------

IF (LHVOLCA) THEN
  ITLATR=46
  ZGRIDR=180./(ITLATR-1)
  DO JLR=1,ITLATR
    ZLATR=90.-(JLR-1)*ZGRIDR
    ZSINR(JLR)=SIN(ZLATR*RPI/180.)
  ENDDO

  DO JL=KIDIA,KFDIA
    INLA=0
    ZSILAT(JL)=-9999.
    DO JLR=1,ITLATR-1
      IF (PSIN(JL) <= ZSINR(JLR) .AND. PSIN(JL) > ZSINR(JLR+1)) THEN
        INLA=JLR
        ZSILAT(JL)=(PSIN(JL)-ZSINR(INLA))/(ZSINR(INLA+1)-ZSINR(INLA))
        ZAERVO(JL)=RTAEVO(INLA)+ZSILAT(JL)*(RTAEVO(INLA+1)-RTAEVO(INLA))
      ENDIF
    ENDDO
    IF (PSIN(JL) <= ZSINR(ITLATR-1) .AND. PSIN(JL) >= ZSINR(ITLATR))THEN
      INLA=ITLATR
      ZSILAT(JL)=(PSIN(JL)-ZSINR(INLA-1))/(ZSINR(INLA)-ZSINR(INLA-1))
      ZAERVO(JL)=RTAEVO(INLA-1)&
       & +ZSILAT(JL)*(RTAEVO(INLA)-RTAEVO(INLA-1))  
    ENDIF
    IF (INLA == 0) THEN
!      CALL ABOR1(' Problem with lat. interpolation in radaca!')
      STOP ' Problem with lat. interpolation in radaca!' 
    ENDIF
  ENDDO

!                 TANRE ET AL. CLIMATOLOGY 
!                 ------------------------

ELSE
  DO JL=KIDIA,KFDIA
    ZAERVO(JL)=RCVOBGA
  ENDDO
ENDIF

!*         1.2    TROPOSPHERIC AEROSOL DISTRIBUTION PARAMETERS
!                 --------------------------------------------

IF (LNEWAER) THEN
!  print *,'LNEWAER= ',LNEWAER
!  print *,' inputs        SINLAT            LONGITUDE'
!  DO JL=KIDIA,KFDIA
!    print 9001,JL,PSIN(JL),PGELAM(JL)
  9001    format(1x,'RADACT ',1x,I5,1x,2E15.8)
!  ENDDO         

!-- latitude       
  ITLATR=46
  ZGRIDR=180./(ITLATR-1)
  DO JLR=1,ITLATR
    ZLATR=90.-(JLR-1)*ZGRIDR
    ZSINR(JLR)=SIN(ZLATR*RPI/180.)
  ENDDO
  ITLONR=72
  ZDLONR=2.*RPI/ITLONR
  DO JLR=1,ITLONR
    ZLONR(JLR)=(JLR-1)*ZDLONR
  ENDDO

!  print *,'Reference grid for Tegen climatology'        
!  print 9121,(ZSINR(JLR),JLR=1,NLATR)
  9121     format(1x,'ZSINR ',8E15.7)
!  print 9122,(ZLONR(JLR),JLR=1,NLONR)
  9122     format(1x,'ZLONR ',8E15.7)
           
  DO JL=KIDIA,KFDIA         
    IINLA1(JL)=0
    IINLA2(JL)=0
    ZSILAT(JL)=-9999.
        DO JLR=1,ITLATR-1
      IF (PSIN(JL) <= ZSINR(JLR) .AND. PSIN(JL) > ZSINR(JLR+1)) THEN
        INLA=JLR
        IINLA1(JL)=JLR
        IINLA2(JL)=JLR+1
        ZSILAT(JL)=(PSIN(JL)-ZSINR(INLA))/(ZSINR(INLA+1)-ZSINR(INLA))
      ENDIF
    ENDDO
    IF (PSIN(JL) <= ZSINR(ITLATR-1) .AND. PSIN(JL) >= ZSINR(ITLATR))THEN
      INLA=ITLATR
      IINLA1(JL)=ITLATR-1
      IINLA2(JL)=ITLATR
      ZSILAT(JL)=(PSIN(JL)-ZSINR(INLA-1))/(ZSINR(INLA)-ZSINR(INLA-1))
    ENDIF    
    IF (INLA == 0) THEN 
!      CALL ABOR1(' Problem with lat. interpolation in radaca!')
      STOP ' Problem with lat. interpolation in radaca!'
    ENDIF
!    print 9123,JL,PSIN(JL),INLA,ZSINR(INLA),ZSILAT(JL)
    9123     format(1x,'Interp.Latit.',I4,F10.7,I4,2F10.7)          
  ENDDO  

!-- longitude
  DO JL=KIDIA,KFDIA
    IINLO1(JL)=0
    IINLO2(JL)=0
    ZLON(JL)=-9999.
    DO JLR=1,71
      IF (PGELAM(JL) < ZLONR(JLR+1) .AND. PGELAM(JL) >= ZLONR(JLR)) &
         & THEN  
        IINLO1(JL)=JLR
        IINLO2(JL)=JLR+1
        ZNLO1(JL)=ZLONR(JLR)
        ZNLO2(JL)=ZLONR(JLR+1)
      ENDIF
    ENDDO      
    IF (PGELAM(JL) >= ZLONR(72)) THEN
      IINLO1(JL)=72
      IINLO2(JL)= 1
      ZNLO1(JL)=ZLONR(72)
!      ZNLO2(JL)=ZLONR(72)+2.*RPI
      ZNLO2(JL)=ZLONR(72)+ZDLONR
    ENDIF
!    print 9124,JL,PGELAM(JL),IINLO1(JL),IINLO2(JL),ZNLO1(JL),ZNLO2(JL)
    9124     format(1x,'Interp.Longit0.',I4,F10.7,2I5,2F10.7)          
  ENDDO  
 
  DO JL=KIDIA,KFDIA
    IF (IINLO1(JL) == 0 .OR. IINLO2(JL) == 0) THEN 
!      CALL ABOR1(' Problem with long. interpolation in radaca!')
      STOP ' Problem with long. interpolation in radaca!'
    ENDIF
    ZLON(JL)=(PGELAM(JL)-ZNLO1(JL))/(ZNLO2(JL)-ZNLO1(JL))
    INLO1=IINLO1(JL)
    INLO2=IINLO2(JL)
    INLA1=IINLA1(JL)
    INLA2=IINLA2(JL)
    
    ZAERBC1=RTAEBC(INLO1,INLA1) &
     & +ZSILAT(JL)*(RTAEBC(INLO1,INLA2)-RTAEBC(INLO1,INLA1))    
    ZAERBC2=RTAEBC(INLO2,INLA1) &
     & +ZSILAT(JL)*(RTAEBC(INLO2,INLA2)-RTAEBC(INLO2,INLA1))    
    ZAERBC(JL)=ZAERBC1+ZLON(JL)*(ZAERBC2-ZAERBC1)
        
    ZAEROR1=RTAEOR(INLO1,INLA1) &
     & +ZSILAT(JL)*(RTAEOR(INLO1,INLA2)-RTAEOR(INLO1,INLA1))    
    ZAEROR2=RTAEOR(INLO2,INLA1) &
     & +ZSILAT(JL)*(RTAEOR(INLO2,INLA2)-RTAEOR(INLO2,INLA1))    
    ZAEROR(JL)=ZAEROR1+ZLON(JL)*(ZAEROR2-ZAEROR1)
        
    ZAERSD1=RTAESD(INLO1,INLA1) &
     & +ZSILAT(JL)*(RTAESD(INLO1,INLA2)-RTAESD(INLO1,INLA1))    
    ZAERSD2=RTAESD(INLO2,INLA1) &
     & +ZSILAT(JL)*(RTAESD(INLO2,INLA2)-RTAESD(INLO2,INLA1))    
    ZAERSD(JL)=ZAERSD1+ZLON(JL)*(ZAERSD2-ZAERSD1)
        
    ZAERSS1=RTAESS(INLO1,INLA1) &
     & +ZSILAT(JL)*(RTAESS(INLO1,INLA2)-RTAESS(INLO1,INLA1))    
    ZAERSS2=RTAESS(INLO2,INLA1) &
     & +ZSILAT(JL)*(RTAESS(INLO2,INLA2)-RTAESS(INLO2,INLA1))    
    ZAERSS(JL)=ZAERSS1+ZLON(JL)*(ZAERSS2-ZAERSS1)
        
    ZAERSU1=RTAESU(INLO1,INLA1) &
     & +ZSILAT(JL)*(RTAESU(INLO1,INLA2)-RTAESU(INLO1,INLA1))    
    ZAERSU2=RTAESU(INLO2,INLA1) &
     & +ZSILAT(JL)*(RTAESU(INLO2,INLA2)-RTAESU(INLO2,INLA1))    
    ZAERSU(JL)=ZAERSU1+ZLON(JL)*(ZAERSU2-ZAERSU1)
          
!    print 9125,JL,PSIN(JL),PGELAM(JL),ZSILAT(JL) &
!     &      ,RTAESU(INLO1,INLA2),RTAESU(INLO1,INLA1),ZAERSU1 &
!     &      ,RTAESU(INLO2,INLA2),RTAESU(INLO2,INLA1),ZAERSU2 &
!     &                    ,INLA1,INLO1,INLO2,INLA2
!9125     format(1x,'Interp.Longit1.',I4,9F10.7,4I5)          
!    print 9126,JL,PSIN(JL),PGELAM(JL),ZSILAT(JL),ZLON(JL) &
!     &      ,ZNLO1(JL),ZNLO2(JL),INLA1,INLO1,INLO2,INLA2
!9126     format(1x,'Interp.Longit2.',I4,6F10.7,4I5)          
!    print 9127,JL,ZAERBC(JL),ZAEROR(JL),ZAERSD(JL),ZAERSS(JL) &
!     &      ,ZAERSU(JL)
!9127     format(1x,'Interp.Longit3.',I4,5F10.7)          
  ENDDO       
ENDIF

!     ------------------------------------------------------------------

!*         2.     OZONE
!                 -----

DO JL=KIDIA,KFDIA
  ZSIN(JL)=PSIN(JL)
ENDDO

!*       2.1     CALL TO LEGTRI.

!***
CALL LEGTRIV(ZSIN(KIDIA),6,66,ZALP,KFDIA-KIDIA+1)
!***

!*       2.2     *LEGENDRE TRANSFORM FOR OZONE.

DO JL=KIDIA,KFDIA
  DO JMM=1,11
    ZFOZQ(JMM,JL)=0.0
    ZFOZH(JMM,JL)=0.0
  ENDDO
  IMM=0
  IMNC=0
  IMNS=0
  DO JMM=1,6
    IMM=IMM+1
    DO JNN=JMM,6
      IMNC=IMNC+1
      ZFOZQ(IMM,JL)=ZFOZQ(IMM,JL)+ZALP(IMNC,JL)*COZQC(IMNC)
      ZFOZH(IMM,JL)=ZFOZH(IMM,JL)+ZALP(IMNC,JL)*COZHC(IMNC)
    ENDDO
    IF(JMM /= 1) THEN
      IMM=IMM+1
      DO JNN=JMM,6
        IMNS=IMNS+1
        ZFOZQ(IMM,JL)=ZFOZQ(IMM,JL)+ZALP(IMNS+6,JL)*COZQS(IMNS)
        ZFOZH(IMM,JL)=ZFOZH(IMM,JL)+ZALP(IMNS+6,JL)*COZHS(IMNS)
      ENDDO
    ENDIF
  ENDDO
ENDDO

!*       2.3     FOURIER TRANSFORM FOR OZONE.

DO JL=KIDIA,KFDIA
  ZCOS1=PCLON(JL)
  ZSIN1=PSLON(JL)
  ZCOS2=ZCOS1*ZCOS1-ZSIN1*ZSIN1
  ZSIN2=ZSIN1*ZCOS1+ZCOS1*ZSIN1
  ZCOS3=ZCOS2*ZCOS1-ZSIN2*ZSIN1
  ZSIN3=ZSIN2*ZCOS1+ZCOS2*ZSIN1
  ZCOS4=ZCOS3*ZCOS1-ZSIN3*ZSIN1
  ZSIN4=ZSIN3*ZCOS1+ZCOS3*ZSIN1
  ZCOS5=ZCOS4*ZCOS1-ZSIN4*ZSIN1
  ZSIN5=ZSIN4*ZCOS1+ZCOS4*ZSIN1
  ZOZQ(JL)=&
   & ZFOZQ(1,JL)+2.0*(ZFOZQ(2,JL)*ZCOS1+ZFOZQ(3,JL)*ZSIN1+ZFOZQ(4,JL)*ZCOS2 &
   & +ZFOZQ(5,JL)*ZSIN2+ZFOZQ(6,JL)*ZCOS3+ZFOZQ(7,JL)*ZSIN3+ZFOZQ(8,JL)&
   & *ZCOS4+ZFOZQ(9,JL)*ZSIN4+ZFOZQ(10,JL)*ZCOS5+ZFOZQ(11,JL)*ZSIN5)  
  ZOZH(JL)=&
   & ZFOZH(1,JL)+2.0*(ZFOZH(2,JL)*ZCOS1+ZFOZH(3,JL)*ZSIN1+ZFOZH(4,JL)*ZCOS2 &
   & +ZFOZH(5,JL)*ZSIN2+ZFOZH(6,JL)*ZCOS3+ZFOZH(7,JL)*ZSIN3+ZFOZH(8,JL)&
   & *ZCOS4+ZFOZH(9,JL)*ZSIN4+ZFOZH(10,JL)*ZCOS5+ZFOZH(11,JL)*ZSIN5)  
  ZOZH(JL)=SQRT(ZOZH(JL))**3
ENDDO

!     ------------------------------------------------------------------

!       3.     AEROSOLS
!              --------
!***
!       3.1     CALL TO LEGTRI

!***
CALL LEGTRIV(ZSIN(KIDIA),11,66,ZALP,KFDIA-KIDIA+1)
!***

!       3.2     LEGENDRE TRANSFORM FOR TANRE'S AEROSOLS
!               ---------------------------------------

DO JL=KIDIA,KFDIA
  DO JMM=1,21
    ZFAES(JMM,JL) = 0.0
    ZFAEL(JMM,JL) = 0.0
    ZFAEU(JMM,JL) = 0.0
    ZFAED(JMM,JL) = 0.0
  ENDDO
  IMM  = 0
  IMNC = 0
  IMNS = 0
  DO JMM=1,11
    IMM  = IMM+1
    DO JNN=JMM,11
      IMNC = IMNC+1
      ZFAES(IMM,JL) = ZFAES(IMM,JL)+ZALP(IMNC,JL)*RAESC(IMNC)
      ZFAEL(IMM,JL) = ZFAEL(IMM,JL)+ZALP(IMNC,JL)*RAELC(IMNC)
      ZFAEU(IMM,JL) = ZFAEU(IMM,JL)+ZALP(IMNC,JL)*RAEUC(IMNC)
      ZFAED(IMM,JL) = ZFAED(IMM,JL)+ZALP(IMNC,JL)*RAEDC(IMNC)
    ENDDO
    IF(JMM /= 1) THEN
      IMM  = IMM+1
      DO JNN=JMM,11
        IMNS = IMNS+1
        ZFAES(IMM,JL) = ZFAES(IMM,JL)+ZALP(IMNS+11,JL)*RAESS(IMNS)
        ZFAEL(IMM,JL) = ZFAEL(IMM,JL)+ZALP(IMNS+11,JL)*RAELS(IMNS)
        ZFAEU(IMM,JL) = ZFAEU(IMM,JL)+ZALP(IMNS+11,JL)*RAEUS(IMNS)
        ZFAED(IMM,JL) = ZFAED(IMM,JL)+ZALP(IMNS+11,JL)*RAEDS(IMNS)
      ENDDO
    ENDIF
  ENDDO
ENDDO

!       3.3     FOURIER TRANSFORM FOR TANRE'S AEROSOLS
!               --------------------------------------

DO JL=KIDIA,KFDIA
  ZCOS1    = PCLON(JL)
  ZSIN1    = PSLON(JL)
  ZCOS2    = ZCOS1*ZCOS1-ZSIN1*ZSIN1
  ZSIN2    = ZSIN1*ZCOS1+ZCOS1*ZSIN1
  ZCOS3    = ZCOS2*ZCOS1-ZSIN2*ZSIN1
  ZSIN3    = ZSIN2*ZCOS1+ZCOS2*ZSIN1
  ZCOS4    = ZCOS3*ZCOS1-ZSIN3*ZSIN1
  ZSIN4    = ZSIN3*ZCOS1+ZCOS3*ZSIN1
  ZCOS5    = ZCOS4*ZCOS1-ZSIN4*ZSIN1
  ZSIN5    = ZSIN4*ZCOS1+ZCOS4*ZSIN1
  ZCOS6    = ZCOS5*ZCOS1-ZSIN5*ZSIN1
  ZSIN6    = ZSIN5*ZCOS1+ZCOS5*ZSIN1
  ZCOS7    = ZCOS6*ZCOS1-ZSIN6*ZSIN1
  ZSIN7    = ZSIN6*ZCOS1+ZCOS6*ZSIN1
  ZCOS8    = ZCOS7*ZCOS1-ZSIN7*ZSIN1
  ZSIN8    = ZSIN7*ZCOS1+ZCOS7*ZSIN1
  ZCOS9    = ZCOS8*ZCOS1-ZSIN8*ZSIN1
  ZSIN9    = ZSIN8*ZCOS1+ZCOS8*ZSIN1
  ZCOS10   = ZCOS9*ZCOS1-ZSIN9*ZSIN1
  ZSIN10   = ZSIN9*ZCOS1+ZCOS9*ZSIN1
  ZAES(JL) = ZFAES(1,JL) + 2.0*&
   & ( ZFAES(2,JL)*ZCOS1  + ZFAES(3,JL)*ZSIN1  + ZFAES(4,JL)*ZCOS2 &
   & + ZFAES(5,JL)*ZSIN2  + ZFAES(6,JL)*ZCOS3  + ZFAES(7,JL)*ZSIN3 &
   & + ZFAES(8,JL)*ZCOS4  + ZFAES(9,JL)*ZSIN4  + ZFAES(10,JL)*ZCOS5 &
   & + ZFAES(11,JL)*ZSIN5 + ZFAES(12,JL)*ZCOS6 + ZFAES(13,JL)*ZSIN6 &
   & + ZFAES(14,JL)*ZCOS7 + ZFAES(15,JL)*ZSIN7 + ZFAES(16,JL)*ZCOS8 &
   & + ZFAES(17,JL)*ZSIN8 + ZFAES(18,JL)*ZCOS9 + ZFAES(19,JL)*ZSIN9 &
   & + ZFAES(20,JL)*ZCOS10+ ZFAES(21,JL)*ZSIN10                 )  
  ZAEL(JL) = ZFAEL(1,JL) + 2.0*&
   & ( ZFAEL(2,JL)*ZCOS1  + ZFAEL(3,JL)*ZSIN1  + ZFAEL(4,JL)*ZCOS2 &
   & + ZFAEL(5,JL)*ZSIN2  + ZFAEL(6,JL)*ZCOS3  + ZFAEL(7,JL)*ZSIN3 &
   & + ZFAEL(8,JL)*ZCOS4  + ZFAEL(9,JL)*ZSIN4  + ZFAEL(10,JL)*ZCOS5 &
   & + ZFAEL(11,JL)*ZSIN5 + ZFAEL(12,JL)*ZCOS6 + ZFAEL(13,JL)*ZSIN6 &
   & + ZFAEL(14,JL)*ZCOS7 + ZFAEL(15,JL)*ZSIN7 + ZFAEL(16,JL)*ZCOS8 &
   & + ZFAEL(17,JL)*ZSIN8 + ZFAEL(18,JL)*ZCOS9 + ZFAEL(19,JL)*ZSIN9 &
   & + ZFAEL(20,JL)*ZCOS10+ ZFAEL(21,JL)*ZSIN10                 )  
  ZAEU(JL) = ZFAEU(1,JL) + 2.0*&
   & ( ZFAEU(2,JL)*ZCOS1  + ZFAEU(3,JL)*ZSIN1  + ZFAEU(4,JL)*ZCOS2 &
   & + ZFAEU(5,JL)*ZSIN2  + ZFAEU(6,JL)*ZCOS3  + ZFAEU(7,JL)*ZSIN3 &
   & + ZFAEU(8,JL)*ZCOS4  + ZFAEU(9,JL)*ZSIN4  + ZFAEU(10,JL)*ZCOS5 &
   & + ZFAEU(11,JL)*ZSIN5 + ZFAEU(12,JL)*ZCOS6 + ZFAEU(13,JL)*ZSIN6 &
   & + ZFAEU(14,JL)*ZCOS7 + ZFAEU(15,JL)*ZSIN7 + ZFAEU(16,JL)*ZCOS8 &
   & + ZFAEU(17,JL)*ZSIN8 + ZFAEU(18,JL)*ZCOS9 + ZFAEU(19,JL)*ZSIN9 &
   & + ZFAEU(20,JL)*ZCOS10+ ZFAEU(21,JL)*ZSIN10                 )  
  ZAED(JL) = ZFAED(1,JL) + 2.0*&
   & ( ZFAED(2,JL)*ZCOS1  + ZFAED(3,JL)*ZSIN1  + ZFAED(4,JL)*ZCOS2 &
   & + ZFAED(5,JL)*ZSIN2  + ZFAED(6,JL)*ZCOS3  + ZFAED(7,JL)*ZSIN3 &
   & + ZFAED(8,JL)*ZCOS4  + ZFAED(9,JL)*ZSIN4  + ZFAED(10,JL)*ZCOS5 &
   & + ZFAED(11,JL)*ZSIN5 + ZFAED(12,JL)*ZCOS6 + ZFAED(13,JL)*ZSIN6 &
   & + ZFAED(14,JL)*ZCOS7 + ZFAED(15,JL)*ZSIN7 + ZFAED(16,JL)*ZCOS8 &
   & + ZFAED(17,JL)*ZSIN8 + ZFAED(18,JL)*ZCOS9 + ZFAED(19,JL)*ZSIN9 &
   & + ZFAED(20,JL)*ZCOS10+ ZFAED(21,JL)*ZSIN10                 )  
ENDDO

!*         2.      VERTICAL DISTRIBUTION
!*                 ---------------------

DO JL=KIDIA,KFDIA
  ZDPO(JL)=PAPRS (JL,0)
  ZCPHO3=PAPRS (JL,0)**3
  ZSDPO3=SQRT  (ZCPHO3)

  IF (LNEWAER) THEN
    ZAEQSO(JL)= ZAERSS(JL)*CVDAES(1)
    ZAEQLO(JL)=(ZAEROR(JL)+ZAERSU(JL))*CVDAEL(1)
    ZAEQUO(JL)= ZAERBC(JL)*CVDAEU(1)
    ZAEQDO(JL)= ZAERSD(JL)*CVDAED(1)
  ELSE
    ZAEQSO(JL)=RCAEOPS*ZAES(JL)*CVDAES(1)
    ZAEQLO(JL)=RCAEOPL*ZAEL(JL)*CVDAEL(1)
    ZAEQUO(JL)=RCAEOPU*ZAEU(JL)*CVDAEU(1)
    ZAEQDO(JL)=RCAEOPD*ZAED(JL)*CVDAED(1)
  ENDIF
  ZAETRO(JL)=1.0
  ZQOFO(JL)=ZOZQ(JL)*ZSDPO3 / (ZSDPO3 + ZOZH(JL))
ENDDO

DO JK=1,KLEV
  DO JL=KIDIA,KFDIA
    ZDPN(JL)=PAPRS (JL,JK)
    ZCPHN3=PAPRS (JL,JK)**3
    ZSDPN3=SQRT  (ZCPHN3)

    IF (LNEWAER) THEN
      ZAEQSN(JL)= ZAERSS(JL)*CVDAES(JK+1)
      ZAEQLN(JL)=(ZAEROR(JL)+ZAERSU(JL))*CVDAEL(JK+1)
      ZAEQUN(JL)= ZAERBC(JL)*CVDAEU(JK+1)
      ZAEQDN(JL)= ZAERSD(JL)*CVDAED(JK+1)
    ELSE
      ZAEQSN(JL)=RCAEOPS*ZAES(JL)*CVDAES(JK+1)
      ZAEQLN(JL)=RCAEOPL*ZAEL(JL)*CVDAEL(JK+1)
      ZAEQUN(JL)=RCAEOPU*ZAEU(JL)*CVDAEU(JK+1)
      ZAEQDN(JL)=RCAEOPD*ZAED(JL)*CVDAED(JK+1)
    ENDIF  

    IF (0.5*(PAPRS(JL,JK-1)+PAPRS(JL,JK)) < 999.) THEN
! for models with top above 10hPa
      ZAETRN(JL)=1.0
      ZAETRO(JL)=1.0
    ELSE
      ZAETRN(JL)=ZAETRO(JL)*(MIN(1.0,PTH(JL,JK)/PTH(JL,JK+1)))**RCTRPT
    ENDIF

    ZAETR=SQRT  (ZAETRN(JL)*ZAETRO(JL))
    ZQOFN(JL)=ZOZQ(JL)*ZSDPN3/(ZSDPN3+ZOZH(JL))
    ZDPNMO    =ZDPN(JL)-ZDPO(JL)
    PAER(JL,1,JK)=(1.0-ZAETR)*(RCTRBGA*ZDPNMO+ ZAEQLN(JL)-ZAEQLO(JL))
    PAER(JL,2,JK)=(1.0-ZAETR)*(ZAEQSN(JL)-ZAEQSO(JL))
    PAER(JL,3,JK)=(1.0-ZAETR)*(ZAEQDN(JL)-ZAEQDO(JL))
    PAER(JL,4,JK)=(1.0-ZAETR)*(ZAEQUN(JL)-ZAEQUO(JL))
!old volc  PAER(JL,JK,5)= ZAETR * RCVOBGA*ZDPNMO
    PAER(JL,5,JK)= ZAETR * ZAERVO(JL)*ZDPNMO
    PAER(JL,6,JK)= ZAETR * RCSTBGA*ZDPNMO
!old RH dependence     
!         AADS(JL,JK)=MAX(RCAEADM, (RCAEADK(1)*PAER(JL,1,JK)
!           + RCAEADK(2)*PAER(JL,2,JK)+RCAEADK(3)*PAER(JL,3,JK))/ZDPNMO)
    POZON(JL,JK)=ZQOFN(JL)-ZQOFO(JL)
!**** **************************************************
!**** **************************************************
  ENDDO
  DO JL=KIDIA,KFDIA
    ZDPO(JL)  =ZDPN(JL)
    ZQOFO(JL) =ZQOFN(JL)
    ZAEQSO(JL)=ZAEQSN(JL)
    ZAEQLO(JL)=ZAEQLN(JL)
    ZAEQUO(JL)=ZAEQUN(JL)
    ZAEQDO(JL)=ZAEQDN(JL)
    ZAETRO(JL)=ZAETRN(JL)
  ENDDO

!-- diagnostics in case of problem  
  DO JAER=1,6
    DO JL=KIDIA,KFDIA
      PAER(JL,JAER,JK)=MAX(PAER(JL,JAER,JK),REPAER)
    ENDDO
  ENDDO   
!  print 9101,JK,PAPRS(JL,JK-1),PAPRS(JL,JK),POZON(JL,JK),(PAER(KIDIA,JAER,JK),JAER=1,6)
9101 format(1x,'radaca ',I3,9E12.5)
ENDDO

!     ------------------------------------------------------------------

END SUBROUTINE RADACA
SUBROUTINE RADOZC ( KIDIA , KFDIA , KLON , KTDIA , KLEV,&
 & KRINT , KDLON , KSHIFT,&
 & PAPRS , PGEMU,&
 & POZON                 )  

!***********************************************************************
! CAUTION: THIS ROUTINE WORKS ONLY ON A NON-ROTATED, UNSTRETCHED GRID
!***********************************************************************

!**** *RADOZC* - COMPUTES DISTRIBUTION OF OZONE FROM CLIMATOLOGY

!     PURPOSE.
!     --------

!**   INTERFACE.
!     ----------
!        CALL *RADOZC* FROM *RADINT*

!        EXPLICIT ARGUMENTS :
!        --------------------
!     ==== INPUTS ===
!     ==== OUTPUTS ===

!        IMPLICIT ARGUMENTS :   NONE
!        --------------------

!     METHOD.
!     -------

!     EXTERNALS.
!     ----------

!          NONE

!     REFERENCE.
!     ----------

!        SEE RADIATION'S PART OF THE MODEL'S DOCUMENTATION AND
!        ECMWF RESEARCH DEPARTMENT DOCUMENTATION OF THE "I.F.S"

!     AUTHOR.
!     -------
!     J.-J. MORCRETTE  E.C.M.W.F.    95/01/25

!     MODIFICATIONS.
!     --------------
!          D.SALMOND   ECMWF    99-06-14   Optimisation
!        M.Hamrud      01-Oct-2003 CY28 Cleaning

!-----------------------------------------------------------------------

USE RAD_SCHEME_PARAMETERS, ONLY : RSINC, ROZT, RPROC

IMPLICIT NONE

INTEGER,INTENT(IN)    :: KLON 
INTEGER,INTENT(IN)    :: KLEV 
INTEGER,INTENT(IN)    :: KDLON 
INTEGER,INTENT(IN)    :: KIDIA 
INTEGER,INTENT(IN)    :: KFDIA 
INTEGER               :: KTDIA ! Argument NOT used
INTEGER,INTENT(IN)    :: KRINT 
INTEGER,INTENT(IN)    :: KSHIFT 
REAL   ,INTENT(IN)    :: PAPRS(KLON,KLEV+1) 
REAL   ,INTENT(IN)    :: PGEMU(KLON) 
REAL   ,INTENT(OUT)   :: POZON(KDLON,KLEV) 
!     -----------------------------------------------------------------

!*       0.1   ARGUMENTS.
!              ----------

!     ----------------------------------------------------------------- 

!*       0.2   LOCAL ARRAYS.
!              -------------

REAL :: ZOZLT(0:60) , ZOZON(KDLON,KLEV+1)
REAL :: ZRRR(0:59)

INTEGER :: IL, INLA, JC, JK, JL, IMAXC
REAL    :: ZPMR, ZSILAT, ZSIN
LOGICAL            :: LLATINT


!     ------------------------------------------------------------------
!     ------------------------------------------------------------------
!     ------------------------------------------------------------------

!*         1.     LATITUDE INDEX WITHIN OZONE CLIMATOLOGY
!                 ---------------------------------------

ZSIN=PGEMU(KIDIA)
INLA=0
ZSILAT=-9999.
!IF( LAQUA ) THEN
!  IF(ZSIN <= RSINC(1)) THEN
!    INLA=1
!    LLATINT=.FALSE.
!  ELSEIF(ZSIN >= RSINC(64)) THEN
!    INLA=64
!    LLATINT=.FALSE.
!  ELSE
!    DO JL=63,1,-1
!      IF (ZSIN <= RSINC(JL+1).AND.ZSIN >= RSINC(JL)) THEN
!        INLA=JL
!      ENDIF
!    ENDDO
!    ZSILAT=(ZSIN-RSINC(INLA))/(RSINC(INLA+1)-RSINC(INLA))
!    LLATINT=.TRUE.
!  ENDIF
!ELSE
  DO JL=18,1,-1
    IF (ZSIN <= RSINC(JL+1).AND.ZSIN >= RSINC(JL)) THEN
      INLA=JL
    ENDIF
  ENDDO
!ENDIF
IF (INLA == 0) THEN
!  CALL ABOR1(' Problem with lat. interpolation in radozc!')
  STOP ' Problem with lat. interpolation in radozc!'
ENDIF

!     ------------------------------------------------------------------

!*         2.     LATITUDE INTERPOLATED FIELD
!                 ---------------------------

!IF( LAQUA ) THEN
!  IMAXC=60
!  IF(.NOT.LLATINT) THEN
!    DO JC=0,IMAXC
!      ZOZLT(JC)=ROZT(INLA,JC)
!    ENDDO
!  ELSE
!    DO JC=0,IMAXC
!      ZOZLT(JC)=ROZT(INLA,JC)+ZSILAT*(ROZT(INLA+1,JC)-ROZT(INLA,JC))
!    ENDDO
!  ENDIF
!ELSE
  IMAXC=35
  ZSILAT=(ZSIN-RSINC(INLA))/(RSINC(INLA+1)-RSINC(INLA))
  IF(INLA == 18.OR.INLA == 1) THEN
    DO JC=0,IMAXC
      ZOZLT(JC)=ROZT(INLA,JC)
    ENDDO
  ELSE
    DO JC=0,IMAXC
      ZOZLT(JC)=ROZT(INLA,JC)+ZSILAT*(ROZT(INLA+1,JC)-ROZT(INLA,JC))
    ENDDO
  ENDIF
!ENDIF

!     ------------------------------------------------------------------

!*         3.     VERTICAL INTERPOLATION 
!                 ----------------------

DO JC=0,IMAXC-1
  ZRRR(JC)=(1.0/(RPROC(JC)-RPROC(JC+1)))*(ZOZLT(JC)-ZOZLT(JC+1))
ENDDO

IL=KSHIFT
DO JL=KIDIA,KFDIA,KRINT
  IL=IL+1
  DO JC=0,IMAXC-1
    DO JK=1,KLEV+1
      ZPMR=PAPRS(JL,JK)
      IF(ZPMR >= RPROC(JC).AND.ZPMR < RPROC(JC+1)) &
       & ZOZON(IL,JK)=ZOZLT(JC+1)+(ZPMR-RPROC(JC+1))*ZRRR(JC)  
    ENDDO
  ENDDO
ENDDO

IL=KSHIFT
DO JL=KIDIA,KFDIA,KRINT
  IL=IL+1
  DO JK=1,KLEV+1
    ZPMR=PAPRS(JL,JK)
    ZPMR=PAPRS(JL,JK)
    IF(ZPMR >= RPROC(IMAXC)) ZOZON(IL,JK)=ZOZLT(IMAXC)
  ENDDO
ENDDO

! INTEGRATION IN THE VERTICAL:
IL=KSHIFT
DO JL=KIDIA,KFDIA,KRINT
  IL=IL+1
  DO JK=1,KLEV
    POZON(IL,JK)=(PAPRS(JL,JK+1)-PAPRS(JL,JK))&
     & *(ZOZON(IL,JK)+ZOZON(IL,JK+1))*0.5  
  ENDDO
ENDDO

!     -----------------------------------------------------------

END SUBROUTINE RADOZC
SUBROUTINE UPDCAL(KD0,KM0,KY0,KINC,KD1,KM1,KY1,KLMO,KULOUT)

!**** *UPDCAL*

!     PURPOSE.
!     --------

!     Updates the calendar values.

!**   INTERFACE.
!     ----------

!     CALL UPDCAL(KD0,KM0,KY0,KINC,KD1,KM1,KY1,KLMO,KULOUT)
!          KD0,KM0,KY0 : initial date
!          KINC        : number of days to increment
!          KD1,KM1,KY1 : final date
!          KLMO        : length of the 12 months
!          KULOUT      : output unit (If negative, does not write)

!     METHOD.
!     -------

!     Increases day by day the date, updates if necessary the month and the
!     year.

!     EXTERNALS.
!     ----------

!         NONE

!     AUTHORS.
!     --------

!         M. DEQUE  JAN 91 .
!         Modified 96-07 M. DEQUE Backward increment. of date (Nudging)
!         Modified 99-10 P. VITERBO Control of printing, 2100 compatible

IMPLICIT NONE

INTEGER,INTENT(IN)    :: KD0 
INTEGER,INTENT(IN)    :: KM0 
INTEGER,INTENT(IN)    :: KY0 
INTEGER,INTENT(IN)    :: KINC 
INTEGER,INTENT(OUT)   :: KD1 
INTEGER,INTENT(OUT)   :: KM1 
INTEGER,INTENT(OUT)   :: KY1 
INTEGER,INTENT(OUT)   :: KLMO(12) 
INTEGER,INTENT(IN)    :: KULOUT 
INTEGER :: JD, JM
REAL :: ZHOOK_HANDLE

!*
!     1. LENGTH OF THE MONTHS.
!     ------------------------

!IF (LHOOK) CALL DR_HOOK('UPDCAL',0,ZHOOK_HANDLE)
DO JM=1,12
  KLMO(JM)=31
  IF(JM == 4.OR.JM == 6.OR.JM == 9.OR.JM == 11)KLMO(JM)=30
  IF(JM == 2)THEN
    IF(MOD(KY0,4) == 0 .AND. MOD(KY0,400) /= 100 &
       & .AND. MOD(KY0,400) /= 200 .AND. MOD(KY0,400) /= 300)THEN  
      KLMO(JM)=29
    ELSE
      KLMO(JM)=28
    ENDIF
  ENDIF
ENDDO
KD1=KD0
KM1=KM0
KY1=KY0

!*
!     2. LOOP ON THE DAYS.
!     --------------------

IF(KINC >= 0) THEN
  DO JD=1,KINC
    KD1=KD1+1
    IF(KD1 <= KLMO(KM1)) CYCLE
    KD1=1
    KM1=KM1+1
    IF(KM1 <= 12) CYCLE
    KM1=1
    KY1=KY1+1
    KLMO(2)=28
    IF(MOD(KY1,4) == 0 .AND. MOD(KY1,400) /= 100 &
     & .AND. MOD(KY1,400) /= 200 .AND. MOD(KY1,400) /= 300)KLMO(2)=29  
  ENDDO
ELSE
  DO JD=1,-KINC
    KD1=KD1-1
    IF(KD1 > 0) CYCLE
    KM1=1+MOD(KM1+10,12)
    KLMO(2)=28
    IF(MOD(KY1,4) == 0 .AND. MOD(KY1,400) /= 100 &
     & .AND. MOD(KY1,400) /= 200 .AND. MOD(KY1,400) /= 300)KLMO(2)=29  
    KD1=KLMO(KM1)
    IF(KM1 == 12)KY1=KY1-1
  ENDDO
ENDIF
IF (KULOUT >=0) WRITE(KULOUT,'("  DATE=",3I5)')KY1,KM1,KD1
!IF (LHOOK) CALL DR_HOOK('UPDCAL',1,ZHOOK_HANDLE)
END SUBROUTINE UPDCAL
SUBROUTINE LEGTRIV (PSIN,KCP,KDIM,PALP,KLON)

!**** *LEGTRIV* - *LEGENDRE FUNCTIONS FOR A TRIANGULAR TRUNCATION.

!     J.F.GELEYN     E.C.M.W.F.     03/06/82.

!     PURPOSE.
!     --------

!          THIS ROUTINE COMPUTES THE VALUES *PALP* FOR THE ARGUMENT
!     *PSIN* OF THE NORMALISED *LEGENDRE ASSOCIATED FUNCTIONS IN THE
!     ORDER ((JN1=JM1,KCP),JM1=1,KCP) FOR JN=JN1-1 AND JM=JM1-1 .

!**   INTERFACE.
!     ----------

!          *LEGTRI* IS CALLED FROM *RADMOD*.
!          THERE ARE THREE DUMMY ARGUMENTS: *PSIN* IS THE SINE OF
!     LATITUDE.
!                                           *KCP* IS ONE PLUS THE LIMIT
!     WAVE NUMBER.
!                                           *PALP* IS THE ARRAY OF THE
!     RESULTS.

!     METHOD.
!     -------

!          SIMPLE RECURENCE FORMULA.

!     EXTERNALS.
!     ----------

!          NONE.

!     REFERENCE.
!     ----------

!          NONE.

!     MODIFICATIONS.
!     --------------
!     J.HAGUE      01/07/03   Vector version of LEGTRI created for bit
!                             reproducibility
!        M.Hamrud      01-Oct-2003 CY28 Cleaning

IMPLICIT NONE

INTEGER,INTENT(IN)    :: KDIM 
INTEGER,INTENT(IN)    :: KLON 
REAL   ,INTENT(IN)    :: PSIN(KLON) 
INTEGER,INTENT(IN)    :: KCP 
REAL   ,INTENT(OUT)   :: PALP(KDIM,KLON) 
INTEGER :: IC, ICP, II, IM, IM2, JM1, JN, JL

!REAL_B :: ZE1
REAL :: ZE1(KCP,KCP)
!REAL_B :: ZE2
REAL :: ZE2(KCP,KCP)

REAL :: Z2M, ZCOS, ZF1M, ZF2M, ZM, ZN, ZN2, ZRE1, ZSIN

!     ------------------------------------------------------------------

!*         1.     PRELIMINARY SETTING.
!                 ----------- --------

ICP=KCP
IC=ICP-1
DO JM1=1,ICP
  IM=JM1-1
  ZM=IM
  Z2M=ZM+ZM
  ZRE1=SQRT(Z2M+3.)
  IM2=IM+2
  ZE1(IM2-1,JM1)=1.0/ZRE1
  DO JN=IM2,IC
    ZN=JN
    ZN2=ZN**2
    ZE2(JN,JM1)=SQRT((4.*ZN2-1.0)/(ZN2-ZM**2))
    ZE1(JN,JM1)=1.0/ZE2(JN,JM1)
  ENDDO
ENDDO

DO JL=1,KLON

  ZSIN=PSIN(JL)
  ICP=KCP

!     ------------------------------------------------------------------

!*         2.     COMPUTATIONS.
!                 -------------

  IC=ICP-1
  ZCOS=SQRT(1.0-ZSIN**2)
  II=2
  PALP(1,JL)=1.0
  ZF1M=SQRT(3.)
  PALP(2,JL)=ZF1M*ZSIN
  DO JM1=1,ICP
    IM=JM1-1
    ZM=IM
    Z2M=ZM+ZM
    ZRE1=SQRT(Z2M+3.)
!   ZE1=_ONE_/ZRE1
    IF(IM == 0) GO TO 201
    ZF2M=ZF1M*ZCOS/SQRT(Z2M)
    ZF1M=ZF2M*ZRE1
    II=II+1
    PALP(II,JL)=ZF2M
    IF(IM == IC) GO TO 203
    II=II+1
    PALP(II,JL)=ZF1M*ZSIN
    IF(JM1 == IC) GO TO 203
    201 CONTINUE
    IM2=IM+2
    DO JN=IM2,IC
!     ZN=JN
!     ZN2=ZN**2
!     ZE2=SQRT((4.*ZN2-_ONE_)/(ZN2-ZM**2))
      II=II+1
!     PALP(II,JL)=ZE2*(ZSIN*PALP(II-1,JL)-ZE1*PALP(II-2,JL))
      PALP(II,JL)=ZE2(JN,JM1)*(ZSIN*PALP(II-1,JL)-ZE1(JN-1,JM1)*PALP(II-2,JL)) 
!     ZE1=_ONE_/ZE2(JN,JM1)
    ENDDO
    203 continue
  ENDDO

ENDDO

!     ------------------------------------------------------------------

!*         3.     RETURN.
!                 -------

END SUBROUTINE LEGTRIV
! ---------------------------------------

end module module_radiat_param
